		public struct UniqueItemLayout
		{
			public List<float> Armor;
			public List<float> DPS;
			public List<float> WeaponDamageMin;
			public List<float> WeaponDamageMax;
		};

		public static float GetArmor(int gbid)
		{
			if (!UniqueItemStats.ContainsKey(gbid)) return 0f;
			if (UniqueItemStats[gbid].Armor.Count == 1 || UniqueItemStats[gbid].Armor.First() == UniqueItemStats[gbid].Armor.Last()) return UniqueItemStats[gbid].Armor.First();
			return (float)FastRandom.Instance.NextDouble((double)UniqueItemStats[gbid].Armor.First(), (double)UniqueItemStats[gbid].Armor.Last());
		}

		public static float GetDPS(int gbid)
		{
			if (!UniqueItemStats.ContainsKey(gbid)) return 0f;
			if (UniqueItemStats[gbid].DPS.Count == 1 || UniqueItemStats[gbid].DPS.First() == UniqueItemStats[gbid].DPS.Last()) return UniqueItemStats[gbid].DPS.First();
			return (float)FastRandom.Instance.NextDouble((double)UniqueItemStats[gbid].DPS.First(), (double)UniqueItemStats[gbid].DPS.Last());
		}

		public static float GetWeaponDamageMin(int gbid)
		{
			if (!UniqueItemStats.ContainsKey(gbid)) return 0f;
			if (UniqueItemStats[gbid].WeaponDamageMin.Count == 1 || UniqueItemStats[gbid].WeaponDamageMin.First() == UniqueItemStats[gbid].WeaponDamageMin.Last()) return UniqueItemStats[gbid].WeaponDamageMin.First();
			return (float)FastRandom.Instance.NextDouble((double)UniqueItemStats[gbid].WeaponDamageMin.First(), (double)UniqueItemStats[gbid].WeaponDamageMin.Last());
		}

		public static float GetWeaponDamageMax(int gbid)
		{
			if (!UniqueItemStats.ContainsKey(gbid)) return 0f;
			if (UniqueItemStats[gbid].WeaponDamageMax.Count == 1 || UniqueItemStats[gbid].WeaponDamageMax.First() == UniqueItemStats[gbid].WeaponDamageMax.Last()) return UniqueItemStats[gbid].WeaponDamageMax.First();
			return (float)FastRandom.Instance.NextDouble((double)UniqueItemStats[gbid].WeaponDamageMax.First(), (double)UniqueItemStats[gbid].WeaponDamageMax.Last());
		}

		public static float GetWeaponDamageDelta(int gbid)
		{
			if (!UniqueItemStats.ContainsKey(gbid)) return 0f;
			return GetWeaponDamageMax(gbid) - GetWeaponDamageMin(gbid);
		}

